import './App.css';
import { BrowserRouter as Routes, Route } from 'react-router-dom';
import Page1 from './page/page1';
import Page2 from './page/page2';

export default function App() {
  return (
    <Routes>
      <Route path='/' element={<Page1 />} />
      <Route path='/page2' element={<Page2 />} />
    </Routes>
  );
}
